import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'

const experiment = (props) => (
        <div>
                <Head>
                <script async custom-element="amp-youtube" src="https://cdn.ampproject.org/v0/amp-youtube-0.1.js"></script>
                    <script async custom-element="amp-video" src="https://cdn.ampproject.org/v0/amp-video-0.1.js"></script>
                    <style amp-custom>{`

                    @media screen and (min-width: 320px){

                        .video_boy{
                            display:flex;
                            margin:0;
                        }


                    }

                    `}</style>
                </Head>
                <body>
                    <div>
                    <amp-video id="glass" autoplay loop noaudio layout="responsive" width="700" height="400"><source src="https://ak4.picdn.net/shutterstock/videos/13557164/preview/stock-footage-animation-of-travelling-through-a-storm-in-the-heaven-with-rays-and-clouds.webm" type="video/webm"/></amp-video>
                    </div>
                    <amp-video class="video_boy" autoplay loop noaudio width="320"  height="568" layout="responsive"><source src="https://www.tesla.com/ns_videos/hp_2019/power-hero-mobile.mp4" type="video/mp4"/></amp-video>
                </body>    
        </div>
)

export default withAmp(experiment, {hybrid:true})
